import React, { useState, useEffect } from 'react';
import {VeterinariansApiFactory} from '../json/api.ts';

const SelectVeter = () => {
    const [data, setData]: any  = useState([]);
    const [names, setNames] = useState([]);
    var functionFromApi = VeterinariansApiFactory(); 
    async function getVetDataFromApi() {
        const response = await fetch('https://localhost:7205/api/Veterinarians');
        const { data } = response;
        setData(data);
    }
    useEffect(() => {
        getVetDataFromApi();
    }, []);

    return (
        <select>
        {names.map((name, index) => (
            <option key={index} value={name}>{name}</option>
        ))}
        </select>
    );
};

export default SelectVeter;
